	add("lordship", "{\"term\":\"lordship\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{suffix|lord|ship|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The state or condition of being a lord\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2004\u0027\u0027, Alice Sheppard, \u0027Families of the King: Writing Identity in the Anglo-Saxon Chronicle\u0027, page 2\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"For example, we know that Alfred did connect land tenure with \u0027\u0027lordship\u0027\u0027 and that he was particularly interested in questions of military servic\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2011\u0027\u0027, Daniel Frankforter, \u0027Word of God - Words of Men: The Use and Abuse of Scripture\u0027, page 9\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Lordship\u0027\u0027 entails both privilege and responsibility. Lords have power over their subjects, but that power is granted them so that they can protect and provide for others\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Title applied to a lord (except an archbishop or duke, who is called Grace) or a formal form of address applied to a judge (in Great Britain), etc\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"He\u0027s had his bath,\u0027 she said. \u0027He\u0027s just had his bath, bless his little \u0027\u0027lordship\u0027\u0027s heart\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"chapter\u003d1|passage\u003dCharles had not been employed above six months at Darracott Place, but he was not such a whopstraw as to make the least noise in the performance of his duties when his \u0027\u0027lordship\u0027\u0027 was out of humour\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Seigniory; domain; the territory over which a lord holds jurisdiction; a manor\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"ca. 1690\u0027\u0027, (translator), (author), \u0027The Tenth Satire of Juvenal\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"What lands and \u0027\u0027lordships\u0027\u0027 for their owner know / My quondam barber, but his worship now\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"1832\u0027\u0027, John Burke, \u0027A General and Heraldic Dictionary of the Peerage and Baronetage of the British Empire\u0027, volume I, page 42\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"for whose ransom he compelled Lord Percy to build the castle of Punnoon, in the \u0027\u0027lordship\u0027\u0027 of Eaglesham\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"Dominion; power; authority\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"But Jesus called them \u0027to him\u0027, and saith unto them, Ye know that they which are accounted to rule over the Gentiles exercise \u0027\u0027lordship\u0027\u0027 over them; and their great ones exercise authority upon them\", \"priority\":15}]}, \"synonyms\":{}}");

	add("lorelei", "{\"term\":\"lorelei\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From the w:Lorelei|Lorelei rock on the Rhine, which was haunted by one of these creatures according to German legend.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A siren; a temptress\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1965\u0027\u0027, William Henry Davenport, Ben Siegel, \u0027Biography past and present: selections and critical essays\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"We grew silly, tongue-tied, said foolish things we did not mean to say, shoved one another about in the boat, and finally overturned it. The \u0027\u0027loreleis\u0027\u0027 laughed musical little laughs\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1977\u0027\u0027 Angela Carter, \u0027The Passion of New Eve\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"She was like a mermaid, an isolated creature that lives in fulfillment of its own senses; she lured me on, she was the \u0027\u0027lorelei\u0027\u0027 of the gleaming river of traffic with its million, brilliant eyes that intermittently flowed between us\", \"priority\":5}]}, \"synonyms\":{}}");

